import CartIcon from "../Cart/CartIcon.js";

const HeaderCartButton = (props) => {
  return (
    <button>
      <span>
        <CartIcon />
      </span>
      <span></span>
      <span></span>
    </button>
  );
};

export default HeaderCartButton;
